import React from 'react'

const Quiz = () => {

  var qBank = [
    { id: 1, question: 'Are you?', answer: ['male', 'female'], Rating: [20, 10, 10] },
    { id: 2, question: 'What type of home do you live', answer: ['Mansion (more than 6 bedrooms)', 'Detached', 'Cottage', 'Semi Detached', 'Terrace ( 3 floors)', 'Terrace ( 2 floors)', 'Bungalow', 'Flat (Purpose build)', 'Flat (Conversion)', 'Town House', 'Do you own more that 1 home?'], Rating: [10, 9, 8, 7, 7, 6, 5, 4, 6, 5, 20] },
    { id: 3, question: 'How well is your home insulated', answer: ['Very well', `It's OK`, 'Drafts everywhere', `Don't know`], Rating: [-5, 5, 10, 15] },
    { id: 4, question: 'How many adults (16+) live in your home', answer: [1, 2, 3, 4, 5, '6+'], Rating: [10, 8, 7, 6, 5] }
  ];
  console.log('qBank', qBank);

  return (
    <>
      <section>
        <div className='row'>
          <div className='col'>


            {qBank.map((i, key) => {

              return (<>
                <ul key={key}>
                  <li>{i.question}</li>
                  <li>{i.answer[i].length[i]}</li>
                </ul>

                {/* <label className="form-check-label">{i.question}</label>
                <input className="form-check-input" key={key} type="checkbox" value="" id="flexCheckDefault" /> */}

              </>

              )

            })}
          </div>
        </div>
      </section>
    </>
  )
}
export default Quiz;
